import React from 'react'
import { Navigate, Outlet } from 'react-router'

const Protected=({auth,auth1})=> {
    if(!auth && auth1){
        <Navigate to="/"/>
    }if(auth ){
        return <Outlet/>
    }
  
}

export default Protected
